import { CUR_FOLDER_NOTES } from '../actions/types'

const initialState = {
    notes: [],
};

export default (state = initialState, action) => {
    switch (action.type) {
        case 'C':
            return {
                ...state,
                notes: action.payload,
            };
        default:
            return state;
    }
};
